import React,{Component} from 'react';
import './employee.css';

class Employee extends Component{

    constructor(){
        super()
        this.state = {
            firstName: "",
            lastName: "",
            email: "",
            phone:"",
            gender:""
        }
    }
    render() {
        return(
           <div className="main">
                <h1 className="heading"> Employee Management </h1>
                <h3 className="subheading"> Open Book Assignment Submitted by Gomathi T</h3>
                <button>Create</button>
                
                <input type="text" name="firstName" value={this.state.firstName} placeholder="FirstName" onChange={this.handleOnChange} />
                <input type="text" name="lastName" value={this.state.lastName} placeholder="LastName" onChange={this.handleOnChange} />
           </div> 
        );
    }
}

export default Employee;
